import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxHeight: "100%",
  },
  coverPhotoContainer: {
    width: "100%",
    maxHeight: "30%",
  },
}));

export default useStyles;
